('2', ' Spesifications :<br />- Processor i5 8250U Base Hz: 1.6 GHz, MX Turbo Hz: 3.4 GHz, Cache 6 MB Smart Cache Quad Core up to 8 Threads<br />- RAM 8GB DDR4<br />- Storage 1 TB HDD<br />- OS Windows 10 Home<br />- Graphics Card Dedicated NVIDIA MX130 2GB GDDR5<br />- Display 14&#39;&#39;&#34; &#40;16:9&#41; LED backlit FHD &#40;1920X1020&#41;Glare, Ultra Slim 200nits<br />- Ports 1x Microphone-in/Headphone-out jack, 1x USB 3.0 port, 1x HDMI, 1x MicroSD card reader, 1x USB 2.0 Port<br />- Connectivity Integrated 802.11b/g/n + Bluetooth v4.0<br />- Battery 3 cell Li-ion, 33WHrs<br />- Includes 2 year warranty, VGA Web Camera, ASUS SonicMaster Technology, Fingerprint<br />Wa 08998199566 '),
